        <input type="text" id="name" /><br/><br/>
        <label className="story">Tell us your story:</label>
        <textarea id="story" name="story" rows="20" cols="100" maxLength="500"> Type Here..</textarea>
        </form>
        </div>
        
      
    )
  }
}
